    [],nt"num_tags": 7,nt"name": "refuge-narrative-report-january-to-april-1957-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from January through April of 1957. The report begins by
    summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, and mammals- is also covered. The Refuge development and maintenance section
    discusses physical developments. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    Refuge participation, hunting, fishing, and violations. Items of interest are attached.",nt"owner_org":
